object Solution {
    def minimumIndex(nums: List[Int]): Int = {
        val n = nums.length
        val dominantElement = nums.groupBy(identity).view.mapValues(_.length).maxBy(_._2)._1
        val prefixCounts = nums.scanLeft(0)((acc, num) => acc + (if (num == dominantElement) 1 else 0))
        val totalDominant = prefixCounts.last

        for (i <- 1 until n) {
            val leftDominantCount = prefixCounts(i)
            val rightDominantCount = totalDominant - leftDominantCount
            if (leftDominantCount * 2 > i && rightDominantCount * 2 > n - i) return i - 1
        }
        -1
    }
}
